		AB27B287118A18D400132977 /* KosmicTaskAppleScriptCocoaRunner */ = {
			isa = PBXNativeTarget;
			buildConfigurationList = AB27B292118A18D400132977 /* Build configuration list for PBXNativeTarget "KosmicTaskAppleScriptCocoaRunner" */;
			buildPhases = (
				AB27B28A118A18D400132977 /* Sources */,
				AB27B28D118A18D400132977 /* Frameworks */,
			);
			buildRules = (
			);
			comments = "when linking to the script runner framework;\n\nsee http://www.cocoabuilder.com/archive/xcode/272910-xcode-dyld-external-dynamic-libraries-and-setting-dy-ld-library-path-for-running-targets.html\n\nthe script runner load path is @executable_path/../Frameworks.\n\nThis works fine for bundle plugins etc as the executable path is replaced by the process path.\n\nFor the runner this is not the case. the process path is the runner path and hence the framework will not be found.\n\nWe can either use @rpath and embed the search path in each linked component or use the install_name_tool to change the\npath where the process will search for the framework.\n\nif we install a plugin outside of the app bundle then the rpath will have to include the absolute path to the application.\n\nTypically, you would not install libraries into any place like /\nLibrary/Application Support/Nuovations/lib. Stuff in Application\nSupport should not be critical to the functioning of your app.\n\n<http://developer.apple.com/documentation/MacOSX/Conceptual/BPFileSystem/Art\nicles/LibraryDirectory.html>\n\nRather, the libraries necessary for your app to run should be inside\nthe app bundle. Usually, in MyApp.app/Contents/Frameworks.\n\n<http://developer.apple.com/documentation/CoreFOundation/Conceptual/CFBundle\ns/BundleTypes/BundleTypes.html#//apple_ref/doc/uid/10000123i-CH101-SW19>\n\nTo put them there, create a Copy Files build phase for the application\ntarget in your Xcode project. Add the libraries to that build phase.\n\n<http://developer.apple.com/documentation/developertools/Conceptual/XcodeBui\nldSystem/200-Build_Phases/bs_build_phases.html#//apple_ref/doc/uid/TP400026\n90-CJAHHAJI>\n\nThe next thing you have to do is adjust the references to those\ndependent libraries within your main executable. For this, you create\na Run Script build phase which invokes the install_name_tool command,\nwith the -change option. Also, you should use the @executable_path\nplaceholder in the new path to make it relative to your app's main\nexecutable. For example:\n\ninstall_name_tool -change libboost_filesystem.dylib\n@executable_path/../Frameworks/libboost_filesystem.dylib\n\"$TARGET_BUILD_DIR/$EXECUTABLE_PATH\"\n\n(In case email wraps it, the above is all one line.)\n\nThis Run Script build phase should have $(TARGET_BUILD_DIR)/$\n(EXECUTABLE_PATH) as its input file, to let Xcode know it depends on\nthe executable having been built before it runs.\n\nThat should do it.\n\nCheers,\nKen";
			dependencies = (
				AB27B288118A18D400132977 /* PBXTargetDependency */,
			);
			name = KosmicTaskAppleScriptCocoaRunner;
			productName = KosmicTaskShellScriptRunner;
			productReference = AB27B296118A18D400132977 /* KosmicTaskAppleScriptCocoaRunner */;
			productType = "com.apple.product-type.tool";
		};
