		AB9FEEC20E215DC200CA6801 /* Run Script: Index Help */ = {
			isa = PBXShellScriptBuildPhase;
			buildActionMask = 2147483647;
			comments = "taken from\n\nhttp://outerlevel.com/blog/2006/12/21/automatically-index-your-apple-help-book-with-xcode/\n\nWhen indexing non-English localizations, you might want to add some command line arguments. For example, in Viennas indexing script for zh_CN.lproj, I used the following: /Developer/Applications/Utilities/Help\\ Indexer.app/Contents/MacOS/Help\\ Indexer $TARGET_BUILD_DIR/$UNLOCALIZED_RESOURCES_FOLDER_PATH/zh_CN.lproj/Vienna\\ Help/ -PantherIndexing YES -Tokenizer 5 -UseRemoteRoot NO -IndexAchors YES -MinTermLength 1\n\n\n\nNote that this creates the help index in the final bundle.\nFor more languages simply add more build phases targeting the required language.\n\nBelow is from from help for Help Indexer:\n\nHelp Indexer 2.0\nBasic Documentation\n\nThere are two ways to use the Help Indexer: from the GUI or from the command line.\n\nGUI Preferences\n\n- Generate Tiger optimized indices: Generates a SearchKit index file for a help folder.\n- Generate Panther compatible indices: Generates an AIAT index file for a help folder.\n\t- Tokenizer: Select the tokenizer you wish you use.\n- Use Remote Root: Tells Help Viewer to use this base URL when trying to fetch missing files from the Internet.\n\t- Prefer Network Files to Local Files: Enable this option if you want Help Viewer to fetch files from the Internet using Remote Root by default, only using the local copy when the file cannot be fetched from the network.\n- Logging Options: Choose one of the three levels of logging verbosity.\n- Index anchor information: Enable this option if you want anchors to be indexed. If this option is off, anchors will only be indexed in those files which specify \"anchors\" in their robots META tag.\n\t- Generate summary for files lacking description: Uses Search Kit to choose the most relevant sentence from the document, assuming the document doesn't have an AppleDescription META tag.\n- Stopwords: This is a list of words to exclude from indexing and searching.\n- Minimum term length: This is the character/ideograph length threshhold. If it's set to 3, any tokens the tokenizer returns that have a length of one or two will be ignored and will not be added to the index. Ideograph-based languages should set this to 1. Character-based languages should probably leave it set at 3.\n\n\nCommand Line Usage\n\nFirst, navigate to: Help\\ Indexer/Contents/MacOS/\nTo run, type: ./Help\\ Indexer [help folder path] [optional preference flags]\n\n[help folder path]: Path to the help folder you wish to index.\n[optional preference flags]: You can set any number of preference flags; each is specified in the following manner: -FlagName [value]\n\nThe following preference flags are available (T is for Tiger, P is for Panther):\n\nFLAG\t\t\t\t\tVALUES\tTP\tDESCRIPTION\nPantherIndexing\t\t\tYES, NO\t P\tAre we generating Panther-compatible indices?\nTokenizer\t\t\t    [1<=INT<=5]\t P\tEnglish, European, Korean, Japanese, or Simple\nShowProgress\t\t\tYES, NO\tTP\tEcho status messages to the command line?\nUseRemoteRoot\t\t\tYES, NO\tTP\tAre we using a remote root URL?\nRemoteRoot\t\t\t\t[URL]\t\tTP\tString with URL of remote root. Exclude brackets.\nPreferNetworkFiles\t\tYES, NO\tTP\tPrefer network files?\nLogStyle\t\t\t\t0, 1, 2\tTP\tErrors, Errors & Warnings, or Errors, Warnings, & Status.\nIndexAnchors\t\t\tYES, NO\tTP\tIndex anchors in all files?\nTigerIndexing\t\t\tYES, NO\tT\tAre we generating Tiger-optimized indices?\nGenerateSummaries\t\t\tYES, NO\tT\tGenerate summaries for files lacking a description?\nStopwords\t\t\t\tsee below\tT\tThe list of stopwords to use when generating the index.\nMinTermLength\t\t\t[INT>=1]\tT\tWhen we tokenize on whitespace, what's the minimum length to\n\t\t\t\t\t\t\t\tmake a term? English should be 3; Chinese and Japanese should\n\t\t\t\t\t\t\t\tbe 1\n\nStopwords\nYou can pass in three different values for the stopwords preference.\n1. \"\" is an empty string, and no stopwords will be used;\n2. One of these seven two-letter language codes: {de, en, es, fr, hu, it, sv};\n3. An absolute path to your newline-delimited file of stopwords.\n\nOther Notes\nA log file will be automatically created in /tmp/ with a name in the following format: helpindexingtool####.txt where #### is a random number. When you run the Help Indexing Tool from the command line, you will be informed of the log file's name and location.\n If you don't pass any flags in on the command line, the Help Indexer will use the preferences stored in the ~/Library/Preferences/com.apple.helpindexer.plist defaults file. That file is set when you use the GUI. If that file doesn't exist, the Help Indexer will use its built-in set of defaults: Help\\ Indexer.app/Contents/Resources/defaultSettings.plist. Because of this, you should not rely on the defaults being set a particular way on the command line unless you're sure they haven't changed in the GUI. (Changes to the preferences only \"stick\" when you use the GUI to modify them.) It's best to fully qualify your command line indexing sessions.\n\n\nThe Unarchiver\n\nOnce you've successfully used the Help Indexer to create a .helpindex file, you may want to find out what was indexed. You can use the Unarchiver utility to find out some interesting information about .helpindex files, such as:\n\t The files included in the index (-l)\n\t The anchors included in the index (default)\n\tThe stopwords used in the index (-s)\n\tThe title and description of every file in the index (-v)\n\nThe Unarchiver is in Help Indexer's Resources folder. So:\n\n[/]$ cd /Developer/Applications/Utilities/Help\\ Indexer.app/Contents/Resources/\n[Resources]$ ./Unarchiver \nUsage: ./Unarchiver [-f] [-v|-ls] file.helpindex\n        -f      Force unarchiving of a file that does not end in .helpindex\n        -l      List the indexed files instead of the .helpindex dictionary\n        -s      Lists the stopwords used in the index\n        -v      Verbose output of content in the index\n[Resources]$ ./Unarchiver /Library/Documentation/Help/MacHelp.help/Contents/Resources/English.lproj/axpgs/axpgs.helpindex \n<?xml version=\"1.0\" encoding=\"UTF-8\"?>\n<!DOCTYPE plist PUBLIC \"-//Apple Computer//DTD PLIST 1.0//EN\" \"http://www.apple.com/DTDs/PropertyList-1.0.dtd\">\n<plist version=\"1.0\">\n<dict>\n        <key>SKI_ANCHOR_DATA</key>\n        <dict>\n                <key>access</key>\n                <array>\n                        <string>/MacHelp2.html</string>\n                </array>\n                <key>mchlp001</key>\n                <array>\n                        <string>/MacHelp2.html</string>\n                </array>\n        </dict>\n        <key>SKI_PREFER_NETWORK_FILES</key>\n        <integer>1</integer>\n        <key>SKI_REMOTE_ROOT</key>\n        <string>http://helposx.apple.com/MacHelpR5/MacHelp.help/English.lproj/axpgs/</string>\n        <key>SKI_USE_REMOTE_ROOT</key>\n        <integer>1</integer>\n</dict>\n</plist>\n\n";
			files = (
			);
			inputPaths = (
			);
			name = "Run Script: Index Help";
			outputPaths = (
			);
			runOnlyForDeploymentPostprocessing = 0;
			shellPath = /bin/sh;
